import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { itemsAPI, verificationAPI } from '../services/api';

const Dashboard = ({ user }) => {
  const [stats, setStats] = useState({
    foundItems: 1,
    lostItems: 2,
    matches: 3
  });
  const [recentItems, setRecentItems] = useState({
    found: [],
    lost: []
  });
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      const [foundResponse, lostResponse, matchesResponse] = await Promise.all([
        itemsAPI.getFoundItems().catch(err => ({ data: { items: [] } })),
        itemsAPI.getLostItems().catch(err => ({ data: { items: [] } })),
        verificationAPI.getMatches().catch(err => ({ data: { matches: [] } }))
      ]);

      setStats({
        foundItems: foundResponse.data.items?.length || 1,
        lostItems: lostResponse.data.items?.length || 2,
        matches: matchesResponse.data.matches?.length || 3
      });

      setRecentItems({
        found: foundResponse.data.items?.slice(0, 3) || [],
        lost: lostResponse.data.items?.slice(0, 3) || []
      });
    } catch (error) {
      console.error('Error loading dashboard data:', error);
    }
  };

  if (loading) {
    return (
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
        <div>Loading dashboard...</div>
      </div>
    );
  }

  return (
    <div style={{width: '100%', height: '100vh', position: 'relative', background: 'white', overflow: 'hidden', fontFamily: 'Inter, sans-serif'}}>
      {/* Sidebar */}
      <div style={{width: 326, height: '100vh', left: 0, top: 0, position: 'absolute', background: '#EBF5FD'}}>
        {/* Logo */}
        <div style={{width: 70.27, height: 70.27, left: 5.75, top: 21.43, position: 'absolute', background: 'white', borderRadius: 9999}} />
        <img style={{width: 84, height: 75.38, left: 0, top: 16, position: 'absolute'}} src="https://placehold.co/84x75" alt="Logo" />
        <div style={{left: 111, top: 36, position: 'absolute', color: '#03045E', fontSize: 35, fontFamily: 'Inter', fontWeight: '800'}}>Back2U</div>

        {/* Navigation */}
        <div style={{width: 285, height: 54, left: 20, top: 157, position: 'absolute', background: 'white', boxShadow: '0px 4px 4px 6px rgba(0, 0, 0, 0.25)', borderRadius: 15}} />
        <div style={{left: 96, top: 172, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700'}}>Dashboard</div>

        <Link to="/found-item" style={{textDecoration: 'none'}}>
          <div style={{left: 86, top: 252, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', cursor: 'pointer'}}>Report Found</div>
        </Link>

        <Link to="/lost-item" style={{textDecoration: 'none'}}>
          <div style={{left: 86, top: 317, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', cursor: 'pointer'}}>Report Lost</div>
        </Link>

        <Link to="/matches" style={{textDecoration: 'none'}}>
          <div style={{left: 83, top: 382, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', cursor: 'pointer'}}>My Matches</div>
        </Link>

        {/* Settings */}
        <Link to="/profile" style={{textDecoration: 'none'}}>
          <div style={{left: 120, top: 708, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', cursor: 'pointer'}}>Settings</div>
          <img style={{width: 40, height: 40, left: 64, top: 696, position: 'absolute'}} src="https://placehold.co/40x40" alt="Settings" />
        </Link>

        {/* Help */}
        <div style={{left: 122, top: 765, position: 'absolute', color: '#03045E', fontSize: 16, fontFamily: 'Inter', fontWeight: '700', cursor: 'pointer'}}>Help</div>
        <img style={{width: 40, height: 40, left: 64, top: 754, position: 'absolute'}} src="https://placehold.co/40x40" alt="Help" />
      </div>

      {/* Main Content */}
      <div style={{marginLeft: 326, padding: '20px'}}>
        {/* Header */}
        <div style={{width: 473, left: 610, top: 26, position: 'absolute', color: 'black', fontSize: 35, fontFamily: 'Inter', fontWeight: '800'}}>Welcome Back {user?.name || 'User'} üëã</div>
        <div style={{left: 586, top: 74, position: 'absolute', color: 'black', fontSize: 18, fontFamily: 'Inter', fontWeight: '500'}}>Manage your lost and found items from your dashboard</div>

        {/* Search Bar */}
        <div style={{width: 373, height: 33, left: 339, top: 135, position: 'absolute', opacity: 0.60, boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: 10, border: '1px black solid'}} />
        <div style={{width: 24.16, height: 24.16, left: 350.23, top: 139.92, position: 'absolute', overflow: 'hidden', borderRadius: 10}}>
          <div style={{width: 13.42, height: 13.42, left: 3.02, top: 3.02, position: 'absolute', background: 'rgba(0, 0, 0, 0.16)'}} />
          <div style={{width: 15.10, height: 15.10, left: 3.02, top: 3.02, position: 'absolute', outline: '1.50px rgba(0, 0, 0, 0.80) solid', outlineOffset: '-0.75px'}} />
        </div>
        <div style={{width: 87.17, left: 475.83, top: 143, position: 'absolute', color: 'rgba(0, 0, 0, 0.80)', fontSize: 13, fontFamily: 'Inter', fontWeight: '400'}}>Search here</div>

        {/* Time Filter */}
        <div style={{width: 151, height: 30, left: 962, top: 135, position: 'absolute', background: '#EBF5FD', borderRadius: 10, border: '1px black solid'}} />
        <div style={{width: 80, height: 30, left: 962, top: 135, position: 'absolute', background: 'white', borderRadius: 10, border: '1px black solid'}} />
        <div style={{left: 979, top: 140, position: 'absolute', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '500'}}>Weekly</div>
        <div style={{left: 1056, top: 140, position: 'absolute', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '500'}}>Daily</div>

        {/* Calendar */}
        <div style={{width: 111, height: 30, left: 1130, top: 135, position: 'absolute', borderRadius: 6, border: '2px black solid'}} />
        <div style={{width: 52, height: 20.45, left: 1160, top: 143.98, position: 'absolute', color: 'black', fontSize: 12, fontFamily: 'Inter', fontWeight: '400'}}>Calendar</div>

        {/* Statistics Section */}
        <div style={{width: 853, height: 206, left: 386, top: 189, position: 'absolute', background: 'rgba(0, 119, 182, 0.50)', borderRadius: 20}} />
        <div style={{width: 150.77, left: 412.85, top: 200, position: 'absolute', color: '#03045E', fontSize: 20, fontFamily: 'Inter', fontWeight: '800'}}>Your Statistics</div>

        {/* Stat Cards */}
        <div style={{width: 166.26, height: 100, left: 500.63, top: 242, position: 'absolute', background: '#EBF5FD', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: 12, border: '2px white solid'}} />
        <div style={{width: 13.42, left: 570.85, top: 289, position: 'absolute', color: 'black', fontSize: 25, fontFamily: 'Inter', fontWeight: '600'}}>{stats.foundItems}</div>
        <div style={{width: 100.17, left: 525.41, top: 249, position: 'absolute', color: 'black', fontSize: 18, fontFamily: 'Inter', fontWeight: '600'}}>Item Found</div>

        <div style={{width: 166.26, height: 100, left: 711.30, top: 242, position: 'absolute', background: '#EBF5FD', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: 12, border: '2px white solid'}} />
        <div style={{width: 16.52, left: 789.78, top: 289, position: 'absolute', color: 'black', fontSize: 25, fontFamily: 'Inter', fontWeight: '600'}}>{stats.lostItems}</div>
        <div style={{width: 83.65, left: 748.47, top: 249, position: 'absolute', color: 'black', fontSize: 18, fontFamily: 'Inter', fontWeight: '600'}}>Item Lost</div>

        <div style={{width: 186.47, height: 100, left: 925.06, top: 242, position: 'absolute', background: '#EBF5FD', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)', borderRadius: 12, border: '2px white solid'}} />
        <div style={{width: 17.93, left: 1015, top: 289, position: 'absolute', color: 'black', fontSize: 25, fontFamily: 'Inter', fontWeight: '600'}}>{stats.matches}</div>
        <div style={{width: 163.16, left: 937.46, top: 249, position: 'absolute', color: 'black', fontSize: 18, fontFamily: 'Inter', fontWeight: '600'}}>Potential Matches</div>

        {/* Action Cards */}
        <Link to="/found-item" style={{textDecoration: 'none'}}>
          <div style={{width: 365, height: 99, left: 386, top: 440, position: 'absolute', background: '#C7F7D2', boxShadow: '4px 4px 4px', borderRadius: 20, border: '1px black solid', cursor: 'pointer'}} />
          <div style={{left: 403, top: 456, position: 'absolute'}}>
            <span style={{color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '500'}}>üì± </span>
            <span style={{color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '800'}}>Report Found Item</span>
          </div>
          <div style={{width: 283, left: 424, top: 465, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '500'}}>
            <br/>Found something?<br/> Help someone get their item back!
          </div>
        </Link>

        <Link to="/lost-item" style={{textDecoration: 'none'}}>
          <div style={{width: 365, height: 99, left: 874, top: 440, position: 'absolute', background: '#C7EFF7', boxShadow: '4px 4px 4px', borderRadius: 20, border: '1px black solid', cursor: 'pointer'}} />
          <div style={{left: 898, top: 456, position: 'absolute'}}>
            <span style={{color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '500'}}>üîç</span>
            <span style={{color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '800'}}> Report Lost Item</span>
          </div>
          <div style={{width: 283, left: 912, top: 478, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 14, fontFamily: 'Inter', fontWeight: '500'}}>
            Lost something? <br/>Let others know what you're looking for!<br/>
          </div>
        </Link>

        <Link to="/matches" style={{textDecoration: 'none'}}>
          <div style={{width: 365, height: 99, left: 643, top: 563, position: 'absolute', background: 'rgba(0, 0, 0, 0.43)', boxShadow: '4px 4px 4px', borderRadius: 20, border: '1px black solid', cursor: 'pointer'}} />
          <div style={{left: 667, top: 579, position: 'absolute'}}>
            <span style={{color: 'white', fontSize: 16, fontFamily: 'Inter', fontWeight: '500'}}>üéØ </span>
            <span style={{color: 'white', fontSize: 16, fontFamily: 'Inter', fontWeight: '700'}}>View Matches</span>
          </div>
          <div style={{width: 315, left: 668, top: 596, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 14, fontFamily: 'Inter', fontWeight: '500'}}>
            <br/>Check potential matches and verify ownership
          </div>
        </Link>

        {/* Recent Items Sections */}
        <div style={{width: 445, height: 131, left: 346, top: 679, position: 'absolute', borderRadius: 20, border: '1px black solid'}} />
        <div style={{left: 370, top: 693, position: 'absolute', color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '800'}}>Recent Found Items</div>

        <div style={{width: 445, height: 131, left: 815, top: 679, position: 'absolute', borderRadius: 20, border: '1px black solid'}} />
        <div style={{left: 836, top: 693, position: 'absolute', color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '800'}}>Recent Lost Items</div>
      </div>

      {/* Separator Line */}
      <div style={{width: '100%', height: 0, left: 0, top: 118, position: 'absolute', boxShadow: '4px 4px 4px', outline: '2px rgba(0, 0, 0, 0.50) solid', outlineOffset: '-1px', filter: 'blur(2px)'}} />
    </div>
  );
};

export default Dashboard;
